import React from 'react';

function Newtweet () {
    return (
        <form id="newTweet">
            <input placeholder="Title" required></input>
            <textarea placeholder="Text" required></textarea>
            <button>Post a new tweet</button>
        </form>
    );
}

export default Newtweet;
